import React from 'react';

// Wavy Checkerboard using canvas-drawn pattern
const WavyCheckerboard = ({ position }) => {
  const isTop = position === 'top';

  // Generate wavy checker pattern with proper bent/wave distortion
  const generateWavyPath = () => {
    const rows = 12;
    const cols = 20;
    const cellWidth = 60;
    const cellHeight = 40;
    const paths = [];

    for (let row = 0; row < rows; row++) {
      for (let col = 0; col < cols; col++) {
        // Only draw black squares (checkerboard pattern)
        if ((row + col) % 2 === 0) {
          const baseX = col * cellWidth - 100;
          const baseY = row * cellHeight;

          // Wave distortion function
          const waveX = (x, y) => {
            const wave1 = Math.sin((y / 80) + (x / 200)) * 25;
            const wave2 = Math.sin((x / 150) + (y / 100)) * 15;
            return x + wave1 + wave2;
          };

          const waveY = (x, y) => {
            const wave1 = Math.sin((x / 120) + (y / 80)) * 20;
            const wave2 = Math.cos((y / 200) + (x / 150)) * 10;
            return y + wave1 + wave2;
          };

          // Calculate distorted corners
          const p1 = { x: waveX(baseX, baseY), y: waveY(baseX, baseY) };
          const p2 = { x: waveX(baseX + cellWidth, baseY), y: waveY(baseX + cellWidth, baseY) };
          const p3 = { x: waveX(baseX + cellWidth, baseY + cellHeight), y: waveY(baseX + cellWidth, baseY + cellHeight) };
          const p4 = { x: waveX(baseX, baseY + cellHeight), y: waveY(baseX, baseY + cellHeight) };

          paths.push(
            <path
              key={`${row}-${col}`}
              d={`M ${p1.x} ${p1.y} L ${p2.x} ${p2.y} L ${p3.x} ${p3.y} L ${p4.x} ${p4.y} Z`}
              fill="#1a1a1a"
            />
          );
        }
      }
    }
    return paths;
  };

  return (
    <div className={`checkerboard-container ${position}`}>
      <svg 
        viewBox="0 0 1000 480" 
        preserveAspectRatio={isTop ? "xMidYMax slice" : "xMidYMin slice"}
        className="checkerboard-svg"
      >
        <rect x="-200" y="-50" width="1400" height="600" fill="#F5F5DC"/>
        {generateWavyPath()}
      </svg>
    </div>
  );
};

const SpotifyLogo = () => (
  <svg viewBox="0 0 100 100" className="spotify-logo">
    <circle cx="50" cy="50" r="45" fill="#1a1a1a"/>
    <path 
      className="spotify-bar bar-1"
      d="M25 35 Q50 25 75 35" 
      stroke="#F5F5DC" 
      strokeWidth="8" 
      strokeLinecap="round" 
      fill="none"
    />
    <path 
      className="spotify-bar bar-2"
      d="M30 50 Q50 42 70 50" 
      stroke="#F5F5DC" 
      strokeWidth="7" 
      strokeLinecap="round" 
      fill="none"
    />
    <path 
      className="spotify-bar bar-3"
      d="M35 65 Q50 58 65 65" 
      stroke="#F5F5DC" 
      strokeWidth="6" 
      strokeLinecap="round" 
      fill="none"
    />
  </svg>
);

// Animated pencil lines
const PencilLines = () => (
  <svg className="pencil-lines" viewBox="0 0 1200 800" preserveAspectRatio="xMidYMid slice">
    <path 
      className="pencil-line line-1"
      d="M-50 300 Q200 280 400 320 T800 290 T1250 350"
      stroke="#1a1a1a"
      strokeWidth="2"
      fill="none"
    />
    <path 
      className="pencil-line line-2"
      d="M-50 400 Q300 420 500 380 T900 420 T1250 380"
      stroke="#1a1a1a"
      strokeWidth="2"
      fill="none"
    />
    <path 
      className="pencil-line line-3"
      d="M-50 500 Q250 480 450 520 T850 490 T1250 530"
      stroke="#1a1a1a"
      strokeWidth="2"
      fill="none"
    />
    <ellipse 
      className="pencil-line line-4"
      cx="600" cy="400" rx="280" ry="120"
      stroke="#1a1a1a"
      strokeWidth="2"
      fill="none"
      transform="rotate(-5 600 400)"
    />
    <ellipse 
      className="pencil-line line-5"
      cx="600" cy="400" rx="320" ry="140"
      stroke="#1a1a1a"
      strokeWidth="2"
      fill="none"
      transform="rotate(3 600 400)"
    />
  </svg>
);

// Main Content - Spotify logo and Year are separate
const CenterContent = () => (
  <div className="center-content">
    <div className="spotify-logo-container">
      <SpotifyLogo />
    </div>
    <div className="year-container">
      <span className="year-text">2026</span>
    </div>
  </div>
);

function App() {
  const [animationStarted, setAnimationStarted] = React.useState(false);

  React.useEffect(() => {
    setTimeout(() => setAnimationStarted(true), 100);
  }, []);

  return (
    <div className={`wrapped-container ${animationStarted ? 'animate' : ''}`}>
      <WavyCheckerboard position="top" />
      <WavyCheckerboard position="bottom" />
      <PencilLines />
      <CenterContent />
    </div>
  );
}

export default App;
